import React from "react";
import Navbar from "./components/Navbar";
import Main from "./components/Main";
import Data from "./components/Data";
function App() {
  const colours = ["Red", "Yellow", "Violet"];
  return (
    <div>
      {colours}
      <Navbar />
      <Main />
      <Data />
    </div>
  );
}

export default App;
